window.bookSummaryJSON = "<p>Having an AI control the system can’t be that bad, can it?</p> <p>The Waymakers are gone. Sol Corps and the colonies have reached a fragile peace. But some in the Corps want to install a new AI to prevent another rebellion. Thus, Glitch, a supercomputer built from old Waymaker code, is born. There's just one problem: the AI is incomplete.</p> <p>Humanity has seen its share of brutally oppressive regimes, but none have been by an artificial intelligence… until now.</p> <p>Unleashing its vicious star snakes, Glitch takes control of the system, killing thousands on Day One. Everyone loses someone. Captain Jack Hale and his crew are no exception.</p> <p>Outmatched by a corrupted AI, Jack Hale will need to change the rules if he’s to win. The odds are against him. But it's never a good idea to underestimate Captain Jack Hale...</p> <p>It's Harlock: Space Pirate meets The Expansein Book 2 of this pulse-pounding Military Sci-Fi series from Rachel Aukes, the bestselling author of Black Sheep, Rebel's Run, and 100 Days in Deadland. </p>"; 
